import React from 'react';
import { Typography, TextField, Button, CssBaseline, Container } from '@material-ui/core';

const Login: React.FC = () => {
  return (
    <Container maxWidth="sm" >
      <CssBaseline />
      <Typography variant="h5">ようこそ</Typography>
      <form>
        <TextField
          label="名前"
          name="name"
          variant="outlined"
          size="small"
          fullWidth
          margin="normal" />
        <Button
          variant="contained"
          color="primary"
          fullWidth >
          Click!
        </Button>
      </form>
    </Container>
  );
}

export default LoginTmp;
